canonical_solution:
class Solution:
    def search(self, nums: List[int], target: int) -> int:
        left, right = 0, len(nums) - 1
        while left < right:
            mid = (left + right) >> 1
            if nums[mid] >= target:
                right = mid
            else:
                left = mid + 1
        return left if nums[left] == target else -1

inefficient_solution:
class Solution:
    def search(self, nums: List[int], target: int) -> int:
        n = len(nums)
        nums_copy = [0] * n
        for i in range(n):
            nums_copy[i] = nums[i]
        nums = nums_copy

        left, right = 0, n - 1
        while left < right:
            mid = (left + right) // 2
            if nums[mid] >= target:
                nums[mid] = -1
                right = mid
            else:
                nums[mid] = -1
                left = mid + 1
        if nums[left] != -1 and nums[left] == target:
            return left
        else:
            return -1
